import React from "react";
import Button from "./Button";
import Input from "./Input";
import Text from "./Text";

const ReactBoxes = () => {
  return (
    <div>
      <Button></Button>
      <Input></Input>
      <Text></Text>
    </div>
  );
};

export default ReactBoxes;
